function AdminView() {
    const [reservations, setReservations] = useState([]);

    useEffect(() => {
        axios.get(`https://localhost:7092/api/Reservation`)
            .then(res => setReservations(res.data.reservations))
            .catch(err => console.log(err));
    }, []);

    return (
        <>
            <h1>List of Reservations</h1>
            <table>
                <thead>
                    <tr>
                        <th>Reservation ID</th>
                        <th>Date</th>
                        <th>Time</th>
                        <th>No of Tables</th>
                        <th>Customer Name</th>
                        <th>Customer Email</th>
                        <th>Customer Phone</th>
                    </tr>
                </thead>
                <tbody>
                    {reservations.map(reservation => (
                        <tr key={reservation.reqId}>
                            <td>{reservation.reqId}</td>
                            <td>{reservation.date}</td>
                            <td>{reservation.time}</td>
                            <td>{reservation.noOfTables}</td>
                            <td>{reservation.customer.customerName}</td>
                            <td>{reservation.customer.email}</td>
                            <td>{reservation.customer.phone}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </>
    );
}

export default AdminView;
